package com.common.cache.test;

public class ImgBean {

	private String imgUrl;
	private String text;

	public ImgBean() {
	}

	public String getImgUrl() {
		return imgUrl;
	}

	public void setImgUrl(String imgUrl) {
		this.imgUrl = imgUrl;
	}

	public String getText() {
		return text;
	}

	public void setText(String text) {
		this.text = text;
	}

}
